export function getSvg(account: number, mint: string, time: Date) {
  return `<svg width="800" height="600" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
      <g>
          <title>Layer 1</title>
          <image stroke="null"
              xlink:href="${images[account]}"
              id="svg_1" height="600" width="600" y="-160" x="-120"/>
          <text transform="matrix(0.7 0 0 0.8 65 30)" stroke="#000" xml:space="preserve"
              text-anchor="start" font-family="Noto Sans JP" font-size="30" id="svg_2" y="60" x="140"
              stroke-width="0" fill="#ffffff">${mint}</text>
          <text transform="matrix(0.7 0 0 0.8 65 30)" stroke="#000" xml:space="preserve"
              text-anchor="start" font-family="Noto Sans JP" font-size="30" id="svg_3" y="210" x="120"
              stroke-width="0" fill="#ffffff">${time.toLocaleDateString(
                'chinese'
              )}</text>
          <text transform="matrix(0.7 0 0 0.8 65 30)" stroke="#000" xml:space="preserve"
              text-anchor="start" font-family="Noto Sans JP" font-size="30" id="svg_5" y="240" x="140"
              stroke-width="0" fill="#ffffff">${time.toLocaleTimeString(
                'chinese',
                {
                  hour12: false
                }
              )}</text>
      </g>
  </svg>`;
}

const images: { [account: number]: string } = {
  10: 'data:image/png;base64,',
  20: 'data:image/png;base64,',
  50: 'data:image/png;base64,',
  100: 'data:image/png;base64,'
};
